  song = Song.create(name: "When the Frayed Wind Blows",number: nil, duration: 300, capo: 0, chords: "1> Am-Dm-E-Am- 2> Am-Dm-E-Am x4 3> F-C-E-Am- D-Am-E-Am x2 4> F-C-G-Am- F-C-G-FGAm- 5> Am 2> 3> 4> 5> 2> 6> F-C-E-Am- x5 4> 5> 2> 3> 4> 7> Am-Dm-C-E- Am-Dm-C-Am- Eam",lyrics: " 1> 2> If it starts with an explosion, Do you end it with a bang?, First the whistles start a-blowin', Then the guilty finally hang; There's a storm on the horizon and the waters on the rise, We're watching history repeatin' with the changin' times; The figureheads keep talking but they're buried in the sand, Everyone is pointing fingers everybody plays their hand; The fix is in, the game is rigged the pawns are polarized, You either pick a side or think outside the picket lines; 3> I wonder, is this a revolution or just mass confusion, When every voice is trying to scream the loudest for equality?; While we argue strategy culture and philosophy, People die in city streets all paved with blood and poverty; The power's with a chosen few desperations just a tool, Agents of corruption use to keep the jails and prisons full; Diamond pockets lined with profits earned from broken lives, Misled to pledge by one discrimination under God I'm sayin'; 4> Stop the world, I wanna get off, everything's on fire and it's falling apart; So if we can't turn back can we change the course, When the fury of the frayed wind blows; 5> 2> The preachers sell salvation to the faithful on their knees, Some prey upon our need and want for something to believe; And some have spun the doctrines holy guide toward paradise, To justify injustices and centuries of genocide; Surrender to your temples, to your altars or your shrines, The weapons used by shepherds so the sheep will keep in line; Conflicting congregations thinking only of themselves, If that's the path to heaven I'd hate to see the road to hell; 3> I tell ya' they take a vision make religion, cause division, Keep you vacant and complacent and dependent on a system; By creating ways to separate utilizing class and race, Prejudice perpetuates and keeps monopolies in place; Trickle up or trickle down, stack or spread the wealth around, Someone's hope is runnin' out while fortune feeds a bank account; Empty-promise politicians pander to the poor, While there's money used for funding phony wars on foreign shores I'm sayin'; 4> Stop the world, I wanna get off, Cause they're loading up the bullets and they're dropping the bombs; The propaganda beats to the narrative drums, When the fury of the frayed wind blows; 5> 2> The criminals in Congress, they ain't got no ground to stand, They're building walls and borders, all around the stolen land; A legacy of liberty, that's how the story goes, But conquerers rewrote the past, to suit the status quo; So is it institutions, or the state of human kind, That leads to some exalted over thousands left behind?; They'll push you to your limit but in turn, they'll push their luck, Cause sleeping giants riot when they've finally woken up; 6> Because they're buying your silence with those shiny advertisements, They lie and cheat and steal and tax your habits so you'll finance; What they hide away behind the scenes, cover over underneath, Population exploitation, victimized by vanity; Faces in a magazine, pictures on a pixel screen, Set a lofty standard that disintegrates your self esteem; Race to chase a plastic dream, red carpets and Limousines, Blinded and distracted by the flashbulbs of celebrity; But just beyond the limelight, after fame has run its course, They'll throw you to the lions while a sold-out crowd will roar I'm sayin'; 4> Stop the world, I wanna get off, Cause there's bodies lying, breathless, bleeding, piling up; They shook the bottled Rage, now it's bound to erupt, When the fury of the frayed wind blows; 5> 2> You can think yourself in circles but the answer's never clear, Is there safety with surveillance? Is there freedom without fear?; Unravel and untangle all you thought you understood, And question everything until you question why you should; We'll change the world with flowers, or we'll change the world with guns, We'll plant a seed or dig a grave before it's said and done; But if we come together all for one and one for all, Resistance rises up sure as an empire will fall; 3> So I'll just work toward the future may it crumble for the better, Where tyrannical oppressors are but shadows we remember; No judgment based on color or your lover or your gender, Dismantle older models so they can't be reassembled; But the day the tables turn your way, watch out for a twist of fate, Careful not to stumble and become the very thing you hate; Seek out something comforting, search for something innocent, But you'll never have those eyes that look at life that way again; So you can take the high road, nothing ventured, nothing gained, But you'll fight fire with fire when you're going down in flames I'm sayin'; 4> Stop the world, I wanna get off, Cause we're at each other's throats and now it's choking my heart; And we can burn the earth or extinguish the torch, When the fury of the frayed wind blows; 7> 5>;",bpm: 120, is_public: true, time_signature_id: nil, key_id: nil, scale_id: nil, album_id: 1, submitter_id: 1, )
