  song = Song.create(name: "Checkmate",number: 1, duration: nil, capo: 0, chords: "1> C--Am--G--F-- x2 2> Am--F-- x3 3> Am--F-G 4> C--Am--G--F-G- x3 5> Am--F-- x5 Am--F-G- 6> C--Am--G--F-G- x2 7> Am--F-- Am--F-G- 8> C--Am--G--F-G- C--Am--G--F---- C--Am--G--x ",lyrics: " 1> 2> Haven't we suffered enough? It's the pain and torture of apocalyptic rising no more trust; For the flickering ambition that we all believe we matter just as much; Where were you when the sun was setting, when my pockets were empty and the doors slammed shut; 3> Now I'm fighting and hoping and praying that this might be the day that I just dont wake up; 4> [4 bars] Do we owe each other peace, Casket for eternal sleep, Respite from the hate and fear, Will it ever become clear; Or do we run and hide, from humanity despised, leave it all to fucking rot, because all our hope is lost; 5> [4 bars] gasping for breath as we're chained to a sinking ship, either drowning or burning we know this is the last trip; there's nothing to say there's nothing to do, If knowlege is power we call off the truce; unlearn the patterns that shackle the mind, break this prison of self and leave the ship behind; 6> 2> 3> 2> It's as if their writing out my lines, it's a rerun of a memory that I bought just to pass the time; now I stay in my room and watch the clock unwind; 2> A distant revelation that must have come from another life, what am I who is this (the forsaken catalyst); we don't deserve to live like this (you will take what you get); 7> the blind leading the blind (nowhere to hide); unmask the face of humankind and you may not like what you find; 8> [4 bars] and when I rest my head, I just wish I was dead, But I'm not...; So I'll find a way that I can be okay, Cause we can all weather the storm or we can just try to save face (checkmate); 6> One foot in the door, one in the grave, In the end I hope we have something to save [C];",bpm: 120, is_public: true, time_signature_id: nil, key_id: nil, scale_id: nil, album_id: 23, submitter_id: 1, )
