ns ont englouti les îles, et que les inondations ont frappé les grandes villes; Et par la suite pendant toute une décennie, ce fut les ouragans et puis les incendies; Les tremblements de terre et la grande sécheresse, partout sur les visages on lisait la détresse; 4> Les gens ont du se battre contre les pandémies, décimés par millions par d'atroces maladies; puis les autres sont morts par la soif ou la fin, comme tombent les mouches; Jusqu'à ce qu'il n'y ait plus rien, plus rien, plus rien, ...; 3> Mon frère est mort hier au milie du désert, je suis maintenant le dernier humain de la Terre; Au fond l'intelligence qu'on nous avait donné, n'aura été qu'un beau cadeau empoisonné; 2> Car il ne reste que quelques minutes à ma vie, tout au plus quelques heures je sens que je faiblis; Je ne peux plus marcher j'ai mal à respirer; Adieu l'humanité, adieu, l'humanité",bpm: 120, is_public: true, time_signature_id: nil, key_id: 24, scale_id: 3, album_id: 25, submitter_id: 1, )
