  Progression.create(song_id: 165, sequence: nil, reps: 1, key_id: nil, scale_id: nil, lyrics: "J'suis né da'ins années '70s dans un Québec en plein changement; Où l'emblême de la fleur-de-lys donnait un peu d'espoir aux gens; Mais quand j'regarde ça aujuord'hui j'suis donc pas fier de ma patrie; Ça dort au gaz da'ins bungalows le cul assis su'l statut quo; En s'gavant de télévision et de talk shows les plus stupides; Se laissant mourir su'l divan avec leur petit air candide; Dans ce royaume de la poutine on s'complète en médiocrité; Ben satisfaits de notre routine et du bonheur préfabriqué;",tag: "Couplet 1",song: song, progression_template: progression_template_2)
  Progression.create(song_id: 165, sequence: nil, reps: 1, key_id: nil, scale_id: nil, lyrics: "\"Prendrais-tu un p'tit gratteux?\" me dit l'caissier au dépanneur; \"Enweye le gros, sors ton p'tit deux, être millionnaire c'est le bonheur\"; Y's'met à rêver le samedi, qu'y va p't'être quitter son taudis; Espère toujours maudit moron, t'as une chance sur quatorze millions; Dans l'stationnement du casino un gars s'tire une balle dans la tête; Ayant tout flobé son magot y'avait pu trop l'coeur à la fête; Mais l'gouvernement s'en balance, y's'nourrit à même les gamblers; En exploitant leur dépendance, un peu comme le f'rait un pusher;\" ,tag: \"Couplet 2\" ,song: song, progression_template: progression_template_2)
  Progression.create(song_id: 165, sequence: nil, reps: 1, key_id: nil, scale_id: nil, lyrics: \"\"Prendrais-tu un p'tit gratteux?\" me dit l'caissier au dépanneur; \"Enweye le gros, sors ton p'tit deux, être millionnaire c'est le bonheur\"; Y's'met à rêver le samedi, qu'y va p't'être quitter son taudis; Espère toujours maudit moron, t'as une chance sur quatorze millions;",tag: "Couplet 2",song: song, progression_template: progression_template_2)
  Progression.create(song_id: 165, sequence: nil, reps: 1, key_id: nil, scale_id: nil, lyrics: "On a été pendant des années un petit peuple de yes-man; Qui marchait les fesses serrées quand arrivait le foreman; Aujourd'hui ça' un peu changé les gars sont tous syndiqués; Ça jase trois-quatre autour d'une pelle en r'gardant le plus jeune faire du zèle; Mais faudrait pas s'réjouir trop vite on est encore des porteurs d'eau; À la solde des gens de l'élite et des pleins d'marde en tuxedo; Quand l'boss d'une grosse corporation ferme son usine en Gaspésie; 'Te d'mandera pas ton opinion y' va t'slaquer sans t'dire merci!; ",tag: "Couplet 3",song: song, progression_template: progression_template_2)
  Progression.create(song_id: 165, sequence: nil, reps: 1, key_id: nil, scale_id: nil, lyrics: "Un robineux quête dans la rue au pied d'un grand building en verre; Y va passer inaperçu à la sortie des actionnaires; C'qui compte pour eux c'est les revenus et non les problèmes de la terre; \"C'pas d'ma faute si t'es un trou d'cul moi l'important c'est que j'prospère\"; Et l'premier-ministre fait semblant qui s'en fait pour les pauvres gens; Alors qu'on sait qu'y est au service des fortunés et d'leurs business; L'environnement, la pauvreté ç'pas des sujets prioritaires; On n'entend pas beaucoup parler derrière les portes des ministères;",tag: "Couplet 4",song: song, progression_template: progression_template_2)
  Progression.create(song_id: 165, sequence: nil, reps: 1, key_id: nil, scale_id: nil, lyrics: "Quand on apprend que dans le nord y's'passe de quoi d'pas catholique; Que nos forêts sont mises à mort ça jase dans l'opinion publique; Deux s'maines et ça sombre dans l'oubli l'histoire est morte et enterrée; Et dans le parc d'la Vérendrye ils continuent à tout raser; C'est ça l'problème de ma patrie c'est qu'y'a pas personne pour s'indigner; Contre la fausse démocratie qui sert les riches et les banquiers; Dans cette contrée peuplée d'ignares 'faut pas trop s'rappeler d'son histoire; Ici y'a juste les plaques de char qu'y ont encore un ti-peu d'mémoire...;",tag: "Couplet 5",song: song, progression_template: progression_template_2)
